var myApp=angular.module("myApp",["ngRoute","ngMaterial","ngMessages"]);myApp.config(["$routeProvider","$mdThemingProvider",function(a,b){a.when("/home",{templateUrl:"./routes/home.html",controller:"HomeController"}).when("/search",{templateUrl:"./routes/search.html",controller:"SearchController"}).when("/enter",{templateUrl:"./routes/enter.html",controller:"EnterController"}).when("/meal",{templateUrl:"./routes/meal.html",controller:"MealController"}).when("/list",{templateUrl:"./routes/list.html",controller:"ListController"}).when("/result",{templateUrl:"./routes/result.html",controller:"ResultController"}).otherwise({redirectTo:"home"}),b.theme("default").primaryPalette("grey",{"hue-1":"50","hue-2":"700","hue-3":"900"}).accentPalette("teal",{"hue-1":"100","hue-2":"300","hue-3":"600"})}]);